import React from "react";
import ReactDOM from "react-dom/client";
import "./Assets/Root.css"
import Header from "./Header"

const root = ReactDOM.createRoot(document.getElementById("root"));

root.render(<>
    <Header text="We are Maze Theory. We believe in pushing and redrawing the boundaries of player imagination and bringing to life immersive entertainment experiences that will engage and blow the senses."/>
</>)
